export function login(usuario){

  var url = 'http://localhost:5000/inicio'
  fetch( url ,{
    method: 'POST',
    header: JSON.stringify({
      email: usuario.email,
      password: usuario.password,

    }),
    headers: {
      'Content-Type':'application/json'
    }
  });
}
